mutation UploadScanResult($oID: String!, $gID: String!, $sInput: ScanResultInput!) {
  addScanResult(organizationID: $oID, groupID: $gID, scanResultInput: $sInput) {
    ID
    OrganizationID
    GroupID
  }
}

{
  "oID": "organizationID",
  "gID": "groupID",
  "sInput": {
    "ScannedAt": "ScannedAt",
    "Lang": "Lang",
    "ServerName": "ServerName",
    "Family": "",
    "Release": "",
    "Errors": ""
  }
}
